export const BEGIN = 'BEGIN';
export const SET_GAMER_NAME = 'SET_GAMER_NAME'
export const END = 'END';
export const ATTACK = 'ATTACK'

export const begin = () => ({
type: BEGIN
});

export const setGamerName = (value: string) => ({
  type: SET_GAMER_NAME,
  value
})

export const end = () => ({
  type: END
  });

export const attack= (value) => ({
  type: ATTACK,
  value
})
